import Axios from 'axios';
import React, { useEffect, useState } from 'react'

function RegisteredEvents({userid}) {
    const [registeredList, setRegisteredlist] = useState([]);
    useEffect(()=>{
        Axios.post('http://localhost:3001/getRegisteredList',{
            userid:userid
        })
        .then((res)=>{
            if (res.data){
                setRegisteredlist(res.data);
            }
        })
    },[userid,setRegisteredlist]);
  return (
    <div>
        {
            registeredList.map((ele)=>{
                return (
                    <div key={ele.event.eventid}>
                        <h4>{ele.event.ename}</h4>
                        <div>{ele.event.desc}</div>
                        <div>{ele.event.edate}</div>
                    </div>
                )
            })
        }
    </div>
  )
}

export default RegisteredEvents
